import logo from '../images/logo.png';
import facebookicon from '../images/facebookicon.png';

const viartriallink = "https://www.twitter.com";
const prospanlink = "https://www.twitter.com";

function Footer() {
    return(
        <>
            <div className="footer">
                <div className="container-fluid section">
                    <div className="row">

                        <div className="col">
                            <a href="#home"><img className="logo" src={logo} alt="logo"/></a>
                            <p>Delivering Health, One Prescription At A Time</p>
                            {/* <a href="https://www.flaticon.com/free-icons/facebook" title="facebook icons">Facebook icons created by Freepik - Flaticon</a> */}
                            <p><a href={viartriallink} target="_blank" rel="noreferrer noopener"><img className="mini-icon"  src={facebookicon} alt="Facebook"/>Viartril-S Facebook</a></p>


                            <p><img className="mini-icon"  src={facebookicon} alt="Facebook"/>Viartril-S Facebook</p>
                            <p><img className="mini-icon" href={prospanlink} target="_blank" rel="noreferrer noopener" src={facebookicon} alt="Facebook"/>Prospan Facebook</p>
                        </div>

                        <div className="col">
                            
                        </div>

                        <div className="col">
                        
                        </div>

                    </div>
                </div>
            </div>

        </>
    );
}

export default Footer;
